import { createAnatomy } from "@zag-js/anatomy"

export const anatomy = createAnatomy("pagination").parts("root", "item", "ellipsis", "prevTrigger", "nextTrigger")

export const parts = anatomy.build()
import { dataAttr } from "@zag-js/dom-query"
import type { NormalizeProps, PropTypes } from "@zag-js/types"
import { parts } from "./pagination.anatomy"
import { dom } from "./pagination.dom"
import type { MachineApi, Send, State } from "./pagination.types"
import { getTransformedRange } from "./pagination.utils"

export function connect<T extends PropTypes>(state: State, send: Send, normalize: NormalizeProps<T>): MachineApi<T> {
  const totalPages = state.context.totalPages
  const page = state.context.page
  const translations = state.context.translations

  const previousPage = state.context.previousPage
  const nextPage = state.context.nextPage
  const pageRange = state.context.pageRange

  const type = state.context.type
  const isButton = type === "button"

  const isFirstPage = page === 1
  const isLastPage = page === totalPages
  const pages = getTransformedRange(state.context)

  return {
    page,
    pageSize: state.context.pageSize,
    totalPages,
    pages,
    previousPage,
    nextPage,
    pageRange,
    slice(data) {
      return data.slice(pageRange.start, pageRange.end)
    },
    setCount(count) {
      send({ type: "SET_COUNT", count })
    },
    setPageSize(size) {
      send({ type: "SET_PAGE_SIZE", size })
    },
    setPage(page) {
      send({ type: "SET_PAGE", page })
    },
    goToNextPage() {
      send({ type: "NEXT_PAGE" })
    },
    goToPrevPage() {
      send({ type: "PREVIOUS_PAGE" })
    },
    goToFirstPage() {
      send({ type: "FIRST_PAGE" })
    },
    goToLastPage() {
      send({ type: "LAST_PAGE" })
    },

    getRootProps() {
      return normalize.element({
        id: dom.getRootId(state.context),
        ...parts.root.attrs,
        dir: state.context.dir,
        "aria-label": translations.rootLabel,
      })
    },

    getEllipsisProps(props) {
      return normalize.element({
        id: dom.getEllipsisId(state.context, props.index),
        ...parts.ellipsis.attrs,
        dir: state.context.dir,
      })
    },

    getItemProps(props) {
      const index = props.value
      const isCurrentPage = index === state.context.page

      return normalize.element({
        id: dom.getItemId(state.context, index),
        ...parts.item.attrs,
        dir: state.context.dir,
        "data-index": index,
        "data-selected": dataAttr(isCurrentPage),
        "aria-current": isCurrentPage ? "page" : undefined,
        "aria-label": translations.itemLabel?.({ page: index, totalPages }),
        onClick() {
          send({ type: "SET_PAGE", page: index })
        },
        ...(isButton && { type: "button" }),
      })
    },

    getPrevTriggerProps() {
      return normalize.element({
        id: dom.getPrevTriggerId(state.context),
        ...parts.prevTrigger.attrs,
        dir: state.context.dir,
        "data-disabled": dataAttr(isFirstPage),
        "aria-label": translations.prevTriggerLabel,
        onClick() {
          send({ type: "PREVIOUS_PAGE" })
        },
        ...(isButton && { disabled: isFirstPage, type: "button" }),
      })
    },

    getNextTriggerProps() {
      return normalize.element({
        id: dom.getNextTriggerId(state.context),
        ...parts.nextTrigger.attrs,
        dir: state.context.dir,
        "data-disabled": dataAttr(isLastPage),
        "aria-label": translations.nextTriggerLabel,
        onClick() {
          send({ type: "NEXT_PAGE" })
        },
        ...(isButton && { disabled: isLastPage, type: "button" }),
      })
    },
  }
}
import { createScope } from "@zag-js/dom-query"
import type { MachineContext as Ctx } from "./pagination.types"

export const dom = createScope({
  getRootId: (ctx: Ctx) => ctx.ids?.root ?? `pagination:${ctx.id}`,
  getPrevTriggerId: (ctx: Ctx) => ctx.ids?.prevTrigger ?? `pagination:${ctx.id}:prev`,
  getNextTriggerId: (ctx: Ctx) => ctx.ids?.nextTrigger ?? `pagination:${ctx.id}:next`,
  getEllipsisId: (ctx: Ctx, index: number) => ctx.ids?.ellipsis?.(index) ?? `pagination:${ctx.id}:ellipsis:${index}`,
  getItemId: (ctx: Ctx, page: number) => ctx.ids?.item?.(page) ?? `pagination:${ctx.id}:item:${page}`,
})
import type { MachineContext as Ctx, Pages } from "./pagination.types"

export const range = (start: number, end: number) => {
  let length = end - start + 1
  return Array.from({ length }, (_, idx) => idx + start)
}

export const transform = (items: (string | number)[]): Pages => {
  return items.map((value) => {
    if (typeof value === "number") return { type: "page", value }
    return { type: "ellipsis" }
  })
}

const ELLIPSIS = "ellipsis"

export type PageContext = Pick<Ctx, "siblingCount" | "page" | "totalPages">

export const getRange = (ctx: PageContext) => {
  /**
   * `2 * ctx.siblingCount + 5` explanation:
   * 2 * ctx.siblingCount for left/right siblings
   * 5 for 2x left/right ellipsis, 2x first/last page + 1x current page
   *
   * For some page counts (e.g. totalPages: 8, siblingCount: 2),
   * calculated max page is higher than total pages,
   * so we need to take the minimum of both.
   */
  const totalPageNumbers = Math.min(2 * ctx.siblingCount + 5, ctx.totalPages)

  const firstPageIndex = 1
  const lastPageIndex = ctx.totalPages

  const leftSiblingIndex = Math.max(ctx.page - ctx.siblingCount, firstPageIndex)
  const rightSiblingIndex = Math.min(ctx.page + ctx.siblingCount, lastPageIndex)

  const showLeftEllipsis = leftSiblingIndex > firstPageIndex + 1
  const showRightEllipsis = rightSiblingIndex < lastPageIndex - 1

  const itemCount = totalPageNumbers - 2 // 2 stands for one ellipsis and either first or last page

  if (!showLeftEllipsis && showRightEllipsis) {
    const leftRange = range(1, itemCount)
    return [...leftRange, ELLIPSIS, lastPageIndex]
  }

  if (showLeftEllipsis && !showRightEllipsis) {
    const rightRange = range(lastPageIndex - itemCount + 1, lastPageIndex)
    return [firstPageIndex, ELLIPSIS, ...rightRange]
  }

  if (showLeftEllipsis && showRightEllipsis) {
    const middleRange = range(leftSiblingIndex, rightSiblingIndex)
    return [firstPageIndex, ELLIPSIS, ...middleRange, ELLIPSIS, lastPageIndex]
  }

  const fullRange = range(firstPageIndex, lastPageIndex)
  return fullRange
}

export const getTransformedRange = (ctx: PageContext) => transform(getRange(ctx))
import { createMachine } from "@zag-js/core"
import { compact, isEqual } from "@zag-js/utils"
import type { IntlTranslations, MachineContext, MachineState, UserDefinedContext } from "./pagination.types"

const defaultTranslations: IntlTranslations = {
  rootLabel: "pagination",
  prevTriggerLabel: "previous page",
  nextTriggerLabel: "next page",
  itemLabel({ page, totalPages }) {
    const isLastPage = totalPages > 1 && page === totalPages
    return `${isLastPage ? "last page, " : ""}page ${page}`
  },
}

export function machine(userContext: UserDefinedContext) {
  const ctx = compact(userContext)
  return createMachine<MachineContext, MachineState>(
    {
      id: "pagination",
      initial: "idle",
      context: {
        pageSize: 10,
        siblingCount: 1,
        page: 1,
        type: "button",
        translations: {
          ...defaultTranslations,
          ...ctx.translations,
        },
        ...ctx,
      },

      watch: {
        pageSize: ["setPageIfNeeded"],
      },

      computed: {
        totalPages: (ctx) => Math.ceil(ctx.count / ctx.pageSize),
        previousPage: (ctx) => (ctx.page === 1 ? null : ctx.page - 1),
        nextPage: (ctx) => (ctx.page === ctx.totalPages ? null : ctx.page + 1),
        pageRange: (ctx) => {
          const start = (ctx.page - 1) * ctx.pageSize
          const end = start + ctx.pageSize
          return { start, end }
        },
        isValidPage: (ctx) => ctx.page >= 1 && ctx.page <= ctx.totalPages,
      },

      on: {
        SET_COUNT: [
          {
            guard: "isValidCount",
            actions: ["setCount", "goToFirstPage"],
          },
          {
            actions: "setCount",
          },
        ],
        SET_PAGE: {
          guard: "isValidPage",
          actions: "setPage",
        },
        SET_PAGE_SIZE: {
          actions: "setPageSize",
        },
        FIRST_PAGE: {
          actions: "goToFirstPage",
        },
        LAST_PAGE: {
          actions: "goToLastPage",
        },
        PREVIOUS_PAGE: {
          guard: "canGoToPrevPage",
          actions: "goToPrevPage",
        },
        NEXT_PAGE: {
          guard: "canGoToNextPage",
          actions: "goToNextPage",
        },
      },

      states: {
        idle: {},
      },
    },
    {
      guards: {
        isValidPage: (ctx, evt) => evt.page >= 1 && evt.page <= ctx.totalPages,
        isValidCount: (ctx, evt) => ctx.page > evt.count,
        canGoToNextPage: (ctx) => ctx.page < ctx.totalPages,
        canGoToPrevPage: (ctx) => ctx.page > 1,
      },
      actions: {
        setCount(ctx, evt) {
          ctx.count = evt.count
        },
        setPage(ctx, evt) {
          set.page(ctx, evt.page)
        },
        setPageSize(ctx, evt) {
          set.pageSize(ctx, evt.size)
        },
        goToFirstPage(ctx) {
          set.page(ctx, 1)
        },
        goToLastPage(ctx) {
          set.page(ctx, ctx.totalPages)
        },
        goToPrevPage(ctx) {
          set.page(ctx, ctx.page - 1)
        },
        goToNextPage(ctx) {
          set.page(ctx, ctx.page + 1)
        },
        setPageIfNeeded(ctx, _evt) {
          if (ctx.isValidPage) return
          set.page(ctx, 1)
        },
      },
    },
  )
}

const clampPage = (page: number, totalPages: number) => Math.min(Math.max(page, 1), totalPages)

const set = {
  pageSize: (ctx: MachineContext, value: number) => {
    if (isEqual(ctx.pageSize, value)) return
    ctx.pageSize = value
    ctx.onPageSizeChange?.({ pageSize: ctx.pageSize })
  },
  page: (ctx: MachineContext, value: number) => {
    if (isEqual(ctx.page, value)) return
    ctx.page = clampPage(value, ctx.totalPages)
    ctx.onPageChange?.({ page: ctx.page, pageSize: ctx.pageSize })
  },
}
